import React from 'react'

function Cart({initialItems}) {
    return(
        <div>
            <h1>I am Cart</h1>
            <ul>
                {initialItems.map(item => (
                <li>Name: {item.name}</li>
                ))}
            </ul>

        </div>
    );
}

export default Cart;
